import React from 'react';

const ScriptGenerator = ({ quote }) => {
    const generateScript = (quote) => {
        // Basic script generation logic
        return `In today's video, we explore the quote: "${quote}". Let's dive into its meaning and how it can inspire us to take action!`;
    };

    return (
        <div className="script-generator">
            <h2>Generated Script</h2>
            <p>{generateScript(quote)}</p>
        </div>
    );
};

export default ScriptGenerator;
